import React from 'react'

function SearchBar() {
  return (
    <div>
        <div className="container">
            <div className="row-cols-auto">
                <p></p>
                <input className="searchBar accordion-button" type="text" />
            </div>
        </div>
    </div>
  )
}
export default SearchBar;
